// src/pages/About.jsx
function About() {
  return (
    <section id="about">
      <h1>Sobre este App</h1>
      <p>
        Este é um aplicativo de Lista de Tarefas criado com React. 
        Ele permite que você adicione, marque como concluídas e exclua tarefas facilmente. 
        O objetivo é ajudar na organização do dia a dia de forma simples e prática.
      </p>
      <p>
        Tecnologias utilizadas: React, CSS, React Router e ícones interativos.
      </p>
    </section>
  );
}

export default About;
